import React, { Component } from 'react';
import { Button } from 'reactstrap';

class WarmupButton extends Component {
    render() {
        return (
            <ul>
                <Button color="success"
                    onClick={this.props.warmupClick}>
                                Warm up
                </Button>{' '}
            </ul>
        )
    }
}

export default WarmupButton
